import React from "react";
import Anasayfa from "./components/anasayfa";
import "./App.css";
import { BrowserRouter, Route } from "react-router-dom";
import { Routes } from "react-router-dom";

const App = () => {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Anasayfa />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
};
export default App;
